", "class Solution:

	def fullJustify(self, words, maxWidth):
		if len(words) == 0:
			return []
		res = []
		currFill = 0
		start = -1
		for i in range(len(words) + 1):
			if i < len(words) and len(words[i]) + currFill <= maxWidth:
				if currFill == 0:
					start = i
				currFill += len(words[i]) + 1
			else:
				currFill -= 1
				extra = maxWidth - currFill
				numwords = i - start
				spaces = [1 for _ in range(numwords)]
				if numwords == 1 or i == len(words):
					spaces[-1] = extra
				else:
					spaces[-1] = 0
					for k in range(len(spaces) - 1):
						spaces[k] += extra // (numwords - 1) + (1 if k < extra % (numwords - 1) else 0)
				curr = ''
				for k in range(len(spaces)):
					curr += words[k + start] + ' ' * spaces[k]
				res.append(curr)
				currFill = len(words[i]) + 1 if i < len(words) else 0
				start = i
		return res
", "class Solution:

	def fullJustify(self, words, maxWidth):
		if maxWidth == 0:
			return [' '.join(words)]
		words = words[:]
		results = []
		while words:
			run = []
			c = 0
			while words:
				pad = 1 if run else 0
				if len(words[0]) + pad + c > maxWidth:
					spaces = maxWidth - sum([len(w) for w in run])
					if len(run) == 1:
						line = ''.join(run + [' '] * spaces)
						assert len(line) == maxWidth
						results.append(line)
					else:
						eachSpace = spaces // (len(run) - 1)
						extraSpaces = spaces % (len(run) - 1)
						line = []
						for i in range(len(run)):
							line.append(run[i])
							if i != len(run) - 1:
								line.append(' ' * eachSpace)
								if extraSpaces > 0:
									line.append(' ')
									extraSpaces -= 1
						line = ''.join(line)
						assert len(line) == maxWidth, len(line)
						results.append(line)
					break
				else:
					if run:
						c += 1
					w = words.pop(0)
					run.append(w)
					c += len(w)
		if run:
			line = ' '.join(run)
			line += ' ' * (maxWidth - len(line))
			results.append(line)
		return results
", "class Solution:

	def fullJustify(self, words, maxWidth):
		acc = 0
		(tmp, res) = ([], [])
		for w in words:
			if acc + len(w) + len(tmp) > maxWidth:
				for i in range(maxWidth - acc):
					tmp[i % (len(tmp) - 1 or 1)] += ' '
				res.append(''.join(tmp))
				acc = 0
				tmp = []
			tmp.append(w)
			acc += len(w)
		return res + [' '.join(tmp).ljust(maxWidth)]
", "class Solution(object):

	def fullJustify(self, words, maxWidth):
		(res, line, length_of_line) = ([], [], 0)
		for word in words:
			if length_of_line + len(word) + len(line) > maxWidth:
				for idx in range(maxWidth - length_of_line):
					word_idx = idx % (len(line) - 1 or 1)
					line[word_idx] += ' '
				res.append(''.join(line))
				(line, length_of_line) = ([], 0)
			length_of_line += len(word)
			line.append(word)
		return res + [' '.join(line).ljust(maxWidth)]
